DROP TABLE IF EXISTS `chaseuser`;
CREATE TABLE `chaseuser` (
  `ID` varchar(36) NOT NULL DEFAULT '' COMMENT 'uuid 主键',
  `userID` bigint(20) NOT NULL COMMENT '用户id',
  `lotteryID` tinyint(4) NOT NULL COMMENT '彩种编号',
  `isWinners` tinyint(1) NOT NULL COMMENT '中奖后是否停止追号 0:否,1:是',
  `issue` int(11) NOT NULL DEFAULT '0' COMMENT '追号期号',
  `state` tinyint(2) NOT NULL DEFAULT '7' COMMENT '追号状态5:撤单，6:继续追号，7:追号完成',
  `money` decimal(16,6) NOT NULL COMMENT '金额',
  `winMoney` decimal(16,6) DEFAULT '0.000000' COMMENT '当前奖金',
  `multiple` int(11) NOT NULL DEFAULT '1' COMMENT '倍数',
  `memo` varchar(200) DEFAULT NULL COMMENT '规则描述 真实姓名$身份证号码$手机号码',
  `payState` tinyint(2) NOT NULL DEFAULT '0' COMMENT '订单状态 0：未处理 1:已支付未派奖 2:已派奖未支付 3:已处理',
  `createDate` datetime NOT NULL COMMENT '创建时间',
  `updateDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否有效记录0:有效、1:无效',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `ID` (`ID`),
  KEY `lotteryID` (`lotteryID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='彩票追号订单';

