-- ----------------------------
-- Procedure structure for `chaseorder_pro`
-- ----------------------------
DROP PROCEDURE IF EXISTS `chaseorder_pro`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `chaseorder_pro`(IN `inchaseID` varchar(36),IN `inuserID` int,IN `inmultiple` int,IN `inlotteryID` tinyint,IN `inisWinners` tinyint,IN `intext` text,IN `chasestr` text,IN `betcount` int)
label_pro:BEGIN
	#Routine body goes here...
	declare total tinyint; #追号总期号
	declare next int DEFAULT 1;
	declare _chaseID varchar(36);
	declare orderID varchar(36);
	declare intdate BIGINT;
	declare str1 BIGINT;
	declare userIDStr char(6);
	declare betState int DEFAULT 1;
	declare sumMoney DECIMAL(16,6) DEFAULT 0;
	declare betStr varchar(100);
	declare betIssue BIGINT;
	declare betbs int DEFAULT 1;
	declare betMoney int DEFAULT 1;
  DECLARE strtemp text;

	DECLARE t_error INTEGER DEFAULT 0;  
  DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;

	set strtemp =chasestr;
	set intdate= CONVERT(DATE_FORMAT(NOW(),'%Y%m%d%H%i%S'),SIGNED);
	set userIDStr=LPAD(inuserID,6,0); 
	set _chaseID=inchaseID;
	set total=(LENGTH(strtemp)-LENGTH(REPLACE(strtemp,'&','')))+1;
	#select intdate,userIDStr,total,chaseID;
	#leave label_pro;
	START TRANSACTION; 
	#插入追号总记录
	while next<=total DO
	#date("YmdHis").str_pad((int)$this->post['userID'],6,0,STR_PAD_LEFT).$this->post['lotteryID'].$buyType;
			SET betStr=(select strOfIndex(chasestr,'&',next));
			set betIssue=(select strOfIndex(betStr,'_',1));
			set betbs=(select strOfIndex(betStr,'_',2));
			set betMoney=betbs*2*betcount; 
			set str1=intdate+next;
			set orderID=CONCAT(str1,userIDStr,inlotteryID,3);
			#select orderID ;
			#lotterychase
			VALUES(orderID,_chaseID,betState,betIssue,betbs,betMoney,NOW());

			SET betState=0;
			SET sumMoney=betMoney+sumMoney;
			set next=next+1;

	END WHILE;
	SET betStr=(select strOfIndex(chasestr,'&',1));
	set betIssue=(select strOfIndex(betStr,'_',1));
	#chaseuser
	VALUES(_chaseID,inuserID,inlotteryID,betIssue,inisWinners,sumMoney,inmultiple,NOW());
	#chaseuserentity
	VALUES(_chaseID,intext);
	IF t_error = 1 THEN  
       ROLLBACK;  
  ELSE  
       COMMIT;  
  END IF;  
  select count(*) as count,t_error as fail from lotterychase where `chaseID`=_chaseID;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `strOfIndex`
-- ----------------------------
DROP FUNCTION IF EXISTS `strOfIndex`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `strOfIndex`(
f_string varchar(7900),f_delimiter varchar(5),f_order int) RETURNS varchar(255) CHARSET utf8
BEGIN
  declare result varchar(255) default '';
  set result = reverse(substring_index(reverse(substring_index(f_string,f_delimiter,f_order)),f_delimiter,1));
  return result;
END
;;
DELIMITER ;
